// variables
var fallingMonument = {
	activeItemKeys: ['bottle'],
	newItemProbability: 1,
	newItemTestDelay: 1000,
	maxSpeed: 0.1
}


// init objects
var items = {
	'bottle': initObject('Bottle')
}

// init group
var group = new THREE.Group();
scene.add( group );

setInterval(() => {
 	if(Math.random() < fallingMonument.newItemProbability) {
 		addItem(returnRandomItem(), 10);
 	}
}, fallingMonument.newItemTestDelay);


// render/update function
function update( event ) {
	var time = event.time * 0.0002;

//	camera.position.x = Math.sin( time ) * 8;
//	camera.position.z = Math.cos( time ) * 8;
//	camera.lookAt( scene.position );

	for ( var i = 0; i < group.children.length; i ++ ) {
		var clone = group.children[ i ];
		clone.position.y -= clone.userData.speed;
		clone.rotation.x += 0.01;
		clone.rotation.y += 0.02;

		if ( clone.position.y < -10 ) {
			group.remove(clone)
			clone.remove();
		}
	}
}

// helper functions
function initObject(name) {
	var obj = scene.getObjectByName(name);
	obj.visible = false;
	return obj
}

function returnRandomItem() { 
	var itemIndex = Math.floor(Math.random() * fallingMonument.activeItemKeys.length)
	return items[fallingMonument.activeItemKeys[itemIndex]];
}

function addItem(source, y) {
	var clone = source.clone();
	clone.position.x = Math.random() * 8 - 4;
	clone.position.y = y || Math.random() * 20 - 10;
	clone.position.z = Math.random() * 8 - 4;
	clone.rotation.x = Math.random() * Math.PI;
	clone.rotation.y = Math.random() * Math.PI;
	clone.rotation.z = Math.random() * Math.PI;
	clone.scale.setScalar( Math.random() * 0.5 + 0.15 );
	clone.userData.speed = Math.random() * fallingMonument.maxSpeed + (fallingMonument.maxSpeed / 3);
	clone.visible = true;
	group.add( clone );
}

window.fallingMonument = fallingMonument;
window.tst = 'yo';
// start with 5 random objects
